import React from 'react';
import 'tachyons/css/tachyons.css';

class Card extends React.Component{
    render(){
        return(
            <div className="bg-light-green dib br3">
                <img src="https://robohash.org/1?size=200x200"></img>
                <h3>Name: robo</h3>
                <p>email: robo@gmail.com</p>
            </div>
        );
    }
}

export default Card;
